import React from 'react'
import './App.css'
import fetch from 'node-fetch'

export default class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      json: '休日'
    }
  }

  onClick = () => {
    fetch('https://holidays-jp.github.io/api/v1/date.json')
      .then(response => {
        return response.json()
      })
     .then(
        (result) => {
          this.setState({
            json: json
          });
        },
      )
  }

  render () {
    return (
      <div className='app'>
        <button onClick={this.onClick}>天気取得</button>
        <ul>
          {this.state.json.map(json => (
            <li key={json.id}>
              {json}
            </li>
          ))}
        </ul>
      </div>
    )
  }
}
